  </body>
</html>`;
}

// source={{ uri: 'https://stripe-payments-demo.appspot.com/' }}

export default class App extends React.Component {
  render() {
    return (
      <WebView
        originWhitelist={['*']}
        source={{
          html: stripeCheckoutRedirectHTML(
            'pk_test_DMcLz3qQcHzlWOhTZbiIZXhY00EHVCWLY7'
          ),
        }}
      />
    );
  }
}
